import React from "react";
import { Col, Container, Row } from "react-bootstrap";

const StudUpdate = () => {
  return (
    <Container>
      <Col className="d-flex justify-content-center">
        <Row
          className="row row-cols-2 align-self-center rounded-start"
          style={{ backgroundColor: "#68AEDB", width: "550px"}}
        >
          <Col className="text-center">
            <h1>PAPA PEDRO</h1>
          </Col>

          <Col className="d-flex">
            <Row className="row row-cols-2 flex-fill mx-5">
              <Col style={{ backgroundColor: "#DEC618" }}>h</Col>

              <Col style={{ backgroundColor: "#9900FF" }}>h</Col>
            </Row>
          </Col>
        </Row>
      </Col>
    </Container>
  );
};

export default StudUpdate;
